import "../App.css"
import "./About.css"

export default function About() {
    return(
        <div className="page">
            <div>
                <h2>Hi! I'm tranquilturtle781.</h2>
                <p id="bio">I'm a junior at Brown University studying Applied Mathematics and Computer Science. My primary interests lie in interests in machine learning, data-driven research, and ethical AI. UI/</p>
            </div>
            <img id="profilepic" src="turtle.png"></img>
        </div>
    )
}
